import React from "react";
import { Card, CardContent } from "@material-ui/core";

export const ListaHistorial = ({ envios }) => {
  return (
    <>
      {envios.map((envio) => (
        <Card key={envio.id} style={{ margin: "20px 0" }}>
          <CardContent>
            <p>Clave de envio {envio.id}</p>
            <div>
              <div></div>
              <div>
                <p>{envio.total}</p>
              </div>
            </div>
          </CardContent>
        </Card>
      ))}
    </>
  );
};
